    {ntt"total": 13,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-06-08T03:09:31.353246",nt"name": "n80-1-shotnav-txt-one-minute-shotpoint-navigation-for-seismic-reflection-data-from-western-rhod",nt"isopen":
    false,nt"url": null,nt"notes": "During 1980, a seismic-reflection survey
    utilizing Uniboom seismics was conducted by the U.S. Geological Survey (USGS) in
    western Rhode Island Sound aboard the Research Vessel Neecho. This cruise consisted
    of 2 legs totalling 8 survey days. Data from this survey were recorded in analog
    form and archived at the USGS. As a result of recent interest in the geology of
    Rhode Island Sound and in an effort to make the data more readily accessible while
    preserving the original paper records, the seismic data from this cruise were scanned
    and converted to TIFF images and SEG-Y data files. Navigation data were converted
    from LORAN-C time delays to latitudes and longitudes, which are available in ESRI
    shapefile format and as eastings and northings in space-delimited text format.",nt"license_title":
